var qns = [{"title":"I would not normally discover this movie on my own."},
            {"title":"This movie is different (e.g., in style, genre, topic) from the movies I usually watch."},
            {"title":"This movie is worth watching even though it is different from the movies I usually watch."},
            {"title":"This movie is an interesting discovery although I would be surprised if a movie website (e.g. Netflix, MovieLens) recommends it to me."}
]

export default qns;
